CREATE TABLE dashboard_category ( 
	arctime              integer NOT NULL    ,
	category_id          integer NOT NULL  PRIMARY KEY  
 );

CREATE TABLE dashboard_db_settings ( 
	setting_id           integer NOT NULL  PRIMARY KEY  ,
	name                 varchar(128) NOT NULL    ,
	desc                 varchar(128) NOT NULL    ,
	value                varchar(128) NOT NULL    
 );

CREATE TABLE dashboard_job ( 
	job_id               integer NOT NULL  PRIMARY KEY  ,
	category             integer NOT NULL    ,
	start_date           date NOT NULL    ,
	end_date             date     ,
	accum_hrs            real NOT NULL    ,
	total_hrs            real NOT NULL    
 );

CREATE TABLE dashboard_location ( 
	desc                 varchar(25) NOT NULL    ,
	location_id          integer NOT NULL  PRIMARY KEY  
 );

CREATE TABLE dashboard_task ( 
	uid                  integer NOT NULL    ,
	"type"               integer NOT NULL    ,
	job_id               integer NOT NULL    ,
	machine_id           integer NOT NULL    ,
	datetime             datetime NOT NULL    ,
	task_id              varchar(128) NOT NULL  PRIMARY KEY  
 );

CREATE TABLE dashboard_task_type ( 
	desc                 varchar(25) NOT NULL    ,
	task_type_id         integer NOT NULL  PRIMARY KEY  
 );

CREATE TABLE dashboard_timesheet_entry ( 
	tid                  integer NOT NULL  PRIMARY KEY  ,
	org_timesheet_id     varchar(128) NOT NULL    ,
	payroll_id           integer NOT NULL    ,
	date                 datetime NOT NULL    ,
	shift_end            time NOT NULL    ,
	shift_start          time NOT NULL    ,
	shift_length         real NOT NULL    
 );

CREATE TABLE dashboard_user ( 
	uid                  integer NOT NULL  PRIMARY KEY  ,
	payroll_id           integer NOT NULL    ,
	first_name           varchar(25) NOT NULL    ,
	last_name            varchar(25) NOT NULL    ,
	timesheet_status     boolean NOT NULL    ,
	status               boolean NOT NULL    
 );

CREATE TABLE dashboard_user_list ( 
	first_name           varchar(25) NOT NULL    ,
	last_name            varchar(25) NOT NULL    ,
	employment_status    boolean NOT NULL    ,
	payroll_id           integer NOT NULL  PRIMARY KEY  
 );

CREATE TABLE dashboard_user_type ( 
	desc                 varchar(25) NOT NULL    ,
	level                integer NOT NULL    ,
	status               boolean NOT NULL    ,
	type_id              integer NOT NULL  PRIMARY KEY  
 );

CREATE TABLE dashboard_machine ( 
	desc                 varchar(25) NOT NULL    ,
	location_id          integer     ,
	machine_id           integer NOT NULL  PRIMARY KEY  ,
	FOREIGN KEY ( machine_id ) REFERENCES dashboard_task( machine_id )  
 );

CREATE TABLE dashboard_timesheet ( 
	payroll_id           integer NOT NULL    ,
	date                 date NOT NULL    ,
	shift_start          time NOT NULL    ,
	shift_end            time NOT NULL    ,
	timesheet_id         varchar(128) NOT NULL  PRIMARY KEY  ,
	FOREIGN KEY ( timesheet_id ) REFERENCES dashboard_timesheet_entry( org_timesheet_id )  
 );

CREATE TABLE dashboard_user_role ( 
	id                   integer NOT NULL  PRIMARY KEY AUTOINCREMENT ,
	uid                  integer NOT NULL    ,
	type_id              integer NOT NULL    ,
	FOREIGN KEY ( uid ) REFERENCES dashboard_user( uid )  ,
	FOREIGN KEY ( type_id ) REFERENCES dashboard_user_type( type_id )  
 );

CREATE TABLE dashboard_payroll_user ( 
	first_name           varchar(25) NOT NULL    ,
	last_name            varchar(25) NOT NULL    ,
	employment_status    boolean NOT NULL    ,
	payroll_id           integer NOT NULL  PRIMARY KEY  ,
	FOREIGN KEY ( payroll_id ) REFERENCES dashboard_timesheet( payroll_id )  
 );

CREATE UNIQUE INDEX unq_dashboard_user_role_uid ON dashboard_user_role ( uid );

